import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { WelcomeComponent } from './welcome/welcome.component';
import { ContractComponent } from './contract/contract.component';
import { CreateContractComponent } from './contract/create-contract/create-contract.component';
import { ViewContractsComponent } from './contract/view-contracts/view-contracts.component';

const appRoutes: Routes = [
  { path: '', component: WelcomeComponent },
  { path: 'contracts', component: ContractComponent },
  { path: 'contracts/create-contract', component: CreateContractComponent},
  { path: 'contracts/view-contracts', component: ViewContractsComponent}
]

@NgModule({
  imports: [RouterModule.forRoot(appRoutes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
